var element = document.getElementById("map");
var map = L.map(element, { center: [GPS[0][0],GPS[0][1]], zoom:14 });
var mapMarker;
L.tileLayer('http://{s}.tile.osm.org/{z}/{x}/{y}.png', {
    attribution: '&copy; <a href="http://osm.org/copyright">OpenStreetMap</a> contributors'
}).addTo(map);
function setCarLocation(lat,lon) {
  if (mapMarker===undefined) {
    mapMarker = L.marker([lat,lon]).addTo(map);
  } else mapMarker.setLatLng([lat,lon]);
}

function start() {
  var n = 0;
  Puck.write('Bangle.setGPSPower(0,"app");\n', function(r) {
    if (r===null) return;
    var con = Puck.getConnection();
    setInterval(function() {
      if (n>=GPS.length)n=0;
      var fix = GPS[n];
      setCarLocation(fix[0],fix[1]);
      con.write(`\x10Bangle.emit("GPS",{fix:1,satellites:5,lat:${fix[0]},lon:${fix[1]},alt:${fix[2]},speed:${fix[3]}})\n`);
      n++;
    }, 200);
  });
}
